import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const Hello = () => {
  return (
    <div>
      <p>Hello world</p>
    </div>
  );
};

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
